import React, {useState} from "react"
import Header from "./header"
import Footer from "./footer"
import Note from "./note"

function App(){
  var [time, setTime] = useState(0);

  setInterval(function(){
    setTime(time+1);
  }, 1000);

  return (
    <div>
    <Header />
    <Note />
    <p>{time}</p>
    <Footer />
    </div>

  )
};

export default App;
